        new_price: 35.0,
        old_price: 45.0,
    },
    {
        id: 5,
        name: "Womans Jeans",
        Image: womensJeans,
        new_price: 60.0,
        old_price: 70.0,
    },
    {
        id: 6,
        name: "Youth T-Shirt",
        Image: youthShirt,
        new_price: 20.0,
        old_price: 30.0,
    }
];

export default data_product;
